void mainImage( out vec4 O, vec2 U )
{
    U *= 37. / iResolution.x;
    float t = iTime*3.7;
    O = vec4(20.* sin(2.5* ( U.y
                             +abs( cos( sin(U.y*.7+t) + U.x
                                       -sin(U.y*-.0157)*U.y - t
             )       )     )     )    );
}
